claim.claim-text:
12. A method of selecting an isolated polynucleotide that affects the level of expression of a phospholipase D polypeptide in a plant cell, the method comprising the steps of: 
(a) constructing an isolated polynucleotide comprising a nucleotide sequence of at least one of 30 contiguous nucleotides derived from an isolated polynucleotide of claim 2; 
(b) introducing the isolated polynucleotide into the plant cell; 
(c) measuring the level of the polypeptide in the plant cell containing the polynucleotide; and 
(d) comparing the level of the polypeptide in the plant cell containing the isolated polynucleotide with the level of the polypeptide in a plant cell that does not contain the isolated polynucleotide.

14. A method of selecting an isolated polynucleotide that affects the level of expression of a phospholipase D polypeptide in a plant cell, the method comprising the steps of: 
(a) constructing the isolated polynucleotide of claim 2; 
(b) introducing the isolated polynucleotide into the plant cell; 
(c) measuring the level of the polypeptide in the plant cell containing the polynucleotide; and 
(d) comparing the level of the polypeptide in the plant cell containing the isolated polynucleotide with the level of the polypeptide in a plant cell that does not contain the polynucleotide.

16. A method of obtaining a nucleic acid fragment encoding a phospholipase D polypeptide comprising the steps of: 
(a) probing a cDNA or genomic library with an isolated polynucleotide comprising at least one of 30 contiguous nucleotides derived from a nucleotide sequence selected from the group consisting of SEQ IDNOs:119, 121, 123, 125, 127, 129, 131, and 133 and a complement of such nucleotide sequences; 
(b) identifying a DNA clone that hybridizes with the isolated polynucleotide; 
(c) isolating the identified DNA clone; and 
(d) sequencing a cDNA or genomic fragment that comprises the isolated DNA clone.
